    Guam. The models are produced from data acquired using airborne Light Detection
    and Ranging (LiDAR) sensors. The data is calibrated, classified and processed to
    produce surface models and products including Classified LAS, bare earth Digital
    Elevation Models (DEM), intensity raster images, shapefiles of road centerlines,
